class SearchModel {
  SearchModel({
      bool? error, 
      String? message, 
      List<Category>? category, 
      List<SubCategory>? subCategory, 
      List<MasterCategory>? masterCategory,}){
    _error = error;
    _message = message;
    _category = category;
    _subCategory = subCategory;
    _masterCategory = masterCategory;
}

  SearchModel.fromJson(dynamic json) {
    _error = json['error'];
    _message = json['message'];
    if (json['category'] != null) {
      _category = [];
      json['category'].forEach((v) {
        _category?.add(Category.fromJson(v));
      });
    }
    if (json['sub_category'] != null) {
      _subCategory = [];
      json['sub_category'].forEach((v) {
        _subCategory?.add(SubCategory.fromJson(v));
      });
    }
    if (json['master_category'] != null) {
      _masterCategory = [];
      json['master_category'].forEach((v) {
        _masterCategory?.add(MasterCategory.fromJson(v));
      });
    }
  }
  bool? _error;
  String? _message;
  List<Category>? _category;
  List<SubCategory>? _subCategory;
  List<MasterCategory>? _masterCategory;
SearchModel copyWith({  bool? error,
  String? message,
  List<Category>? category,
  List<SubCategory>? subCategory,
  List<MasterCategory>? masterCategory,
}) => SearchModel(  error: error ?? _error,
  message: message ?? _message,
  category: category ?? _category,
  subCategory: subCategory ?? _subCategory,
  masterCategory: masterCategory ?? _masterCategory,
);
  bool? get error => _error;
  String? get message => _message;
  List<Category>? get category => _category;
  List<SubCategory>? get subCategory => _subCategory;
  List<MasterCategory>? get masterCategory => _masterCategory;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['error'] = _error;
    map['message'] = _message;
    if (_category != null) {
      map['category'] = _category?.map((v) => v.toJson()).toList();
    }
    if (_subCategory != null) {
      map['sub_category'] = _subCategory?.map((v) => v.toJson()).toList();
    }
    if (_masterCategory != null) {
      map['master_category'] = _masterCategory?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

